import React, {Component} from "react";
class Partner extends Component{
    constructor() {
        super();
        this.state = {
            username:'',
            password:'',
            storename:'',
            storeloc:'',
            contactno:'',
            email:''
        }
    }

    changeContact = (event) => {
        this.setState({
            contactno: event.target.value
        })
    }
    changeEmail = (event) => {
        this.setState({
            email: event.target.value
        })
    }
    changeUsername = (event) => {
        this.setState({
            username: event.target.value
        })
    }

    changePassword = (event) => {
        this.setState({
            password: event.target.value
        })
    }
    changeStoreLoc = (event) => {
        this.setState({
            storeloc: event.target.value
        })
    }

    changeStoreName = (event) => {
        this.setState({
            storename: event.target.value
        })
    }

    submitresponse = (event) =>{
        alert('partner')
    }
    render() {
        return (
            <div>
                <form onSubmit={this.submitresponse}>
                    Store Name: <input type="text"  value={this.state.storename} onChange={this.changeStoreName}/>
                    Store Location: <input type="text"  value={this.state.storeloc} onChange={this.changeStoreLoc}/>
                    Contact Number: <input type="text" value={this.state.Phone} onChange={this.changeContact}/>
                    Email: <input type="text" value={this.state.email} onChange={this.changeEmail}/>
                    Username: <input type="text" value={this.state.username} onChange={this.changeUsername}/>
                    Password: <input type="password" value={this.state.password} onChange={this.changePassword}/>
                    <input type="submit" value="Register" onSubmit={this.submitresponse}/>
                </form>
            </div>
        )
    }
}

export default Partner
